            if (this.sidebarHeader.nativeElement.classList.contains('toggled')) {
                this.renderer.removeClass(this.sidebarHeader.nativeElement, 'toggled');
            }
        }
        this.sidebarService.sidebarState.next(this.toggled);
    }
}
